const input = '';

void main() {
  var prev = input;
  prev = run(prev);
  print(prev.length); //part1

  var min = 20000;
  for (var char = 65; char < 91; char++) {
    var lower = (StringBuffer()..writeCharCode(char)).toString();
    var upper = (StringBuffer()..writeCharCode(char+32)).toString();
    var out = run(prev.replaceAll(lower, "").replaceAll(upper, ""));
    if (out.length < min) {
      min = out.length;
    }
  }
  print(min);
}

String run(String prev) {
  while(true) {
    var next = StringBuffer();
    var prevChar = null;
    prev.runes.forEach((r) {
      if (prevChar != null && (prevChar - r).abs() == 32) {
        prevChar = null;
      }
      else {
        if (prevChar != null) next.writeCharCode(prevChar);
        prevChar = r;
      }
    });
    if (prevChar != null) next.writeCharCode(prevChar);
    var eq = (next.toString() == prev);
    prev = next.toString();
    if (eq) break;
  }
  return prev;
}